import { defineEndpoint } from '@directus/extensions-sdk';
import Controller from './controllers';
import LogSys from './helpers/logger';
import config from './config';
import Getters from './db/getters';
import axios from 'axios';

let CRON_RUNNING = false;

export default defineEndpoint(async (router, { services, getSchema, database, env }) => {
	try {
		const { ItemsService } = services;
		const accountabilitySchema = {
			accountability: { admin: true },
			schema: await getSchema(), // function is provided in the extension context
		};

		const controller = new Controller(services, accountabilitySchema);
		const logSys = new LogSys();

		const authMiddleware = async (req, res, next) => {
			try {
				if (!req.headers.authorization) {
					return res.status(403).json({ error: 'No credentials sent!' });
				} else if (req.headers.authorization == config.auth.extension) {
					const newAccountabilitySchema = {
						accountability: { admin: true },
						schema: await getSchema(),
					};

					const { id } = req.body;

					logSys.createLoggerInstance(services.ItemsService, accountabilitySchema, { link: id });
					controller.updateAccountabilitySchema(newAccountabilitySchema);
					logSys.updateAccountabilitySchema(newAccountabilitySchema);

					next();
				} else {
					return res.status(403).json({ error: 'Access Forbidden' });
				}
			} catch (e) {
				res.send({
					success: false,
					message: 'Server Error, Please try later.',
				});
			}
		};

		router.post('/webhook/verify-link', authMiddleware, async (req, res) => {
			try {
				new LogSys().log('Verify Link');

				const { id } = req.body;

				const linkId = id;
				const { success, message, data, error_tag } = await controller.verifyLink(linkId);

				new LogSys().log({
					api: 'Verify Link',
					response: {
						success,
						message,
						data,
						error_tag,
					},
				});

				res.send({
					success,
					message,
					data,
					error_tag,
				});
			} catch (err) {
				console.log("err--->",err)
				await logSys.error({ 'verify-link-error': err });
				res.send({
					success: false,
					message: 'Server Error, Please try later.',
				});
			}
		});

		router.post('/webhook/logout', authMiddleware, async (req, res) => {
			try {
				new LogSys().log('Logout Link');

				const { id } = req.body;

				const linkId = id;

				const { success, message, error_tag } = await controller.logOut(linkId);

				new LogSys().log({
					api: 'Logout Link',
					response: {
						success,
						message,
						error_tag,
					},
				});

				res.send({
					success,
					message,
					error_tag,
				});
			} catch (err) {
				await logSys.error({ 'logout-link-error': err });
				res.send({
					success: false,
					message: 'Server Error, Please try later.',
				});
			}
		});

		router.post('/webhook/sendotp', authMiddleware, async (req, res) => {
			try {
				new LogSys().log('Send Otp');
				let { id, resend, mobile, email, is_send_otp , region_id} = req.body;

				is_send_otp = is_send_otp != 0 ? 1 : is_send_otp;
				const { success, message } = await controller.sendOtp(id, resend, mobile, email, is_send_otp , region_id);

				new LogSys().log({
					api: 'Send Otp',
					is_send_otp: is_send_otp,
					response: {
						success,
						message,
					},
				});

				res.send({
					success,
					message,
				});
			} catch (err) {
				await logSys.error({ 'send-otp-error': err });
				res.send({
					success: false,
					message: 'Server Error, Please try later.',
				});
			}
		});

		router.post('/webhook/verifyotp', authMiddleware, async (req, res) => {
			try {
				new LogSys().log('Verify Otp');
				const { id, otp } = req.body;

				const { success, message, token, token_last_updated, token_expire_in } = await controller.verifyOtp(id, otp);

				new LogSys().log({
					api: 'Verify Otp',
					response: {
						success,
						message,
						token,
						token_last_updated,
						token_expire_in,
					},
				});

				res.send({ success, message, token, token_last_updated, token_expire_in });
			} catch (err) {
				await logSys.error({ 'verify-otp-error': err });
				res.send({
					success: false,
					message: 'Server Error, Please try later.',
				});
			}
		});

		router.post('/webhook/getallmyvoucherDetails', authMiddleware, async (req, res) => {
			try {
				new LogSys().log('Get All My Vouchers');
				const { id, token } = req.body;

				const { success, message, result } = await controller.getMyVouchers(id, token);

				new LogSys().log({
					api: 'Get All My Vouchers',
					response: {
						success,
						message,
						result,
					},
				});

				res.send({ success, message, result });
			} catch (err) {
				await logSys.error({ 'getallmyvoucherDetails-error': err });
				res.send({
					success: false,
					message: 'Server Error, Please try later.',
				});
			}
		});

		/* Generate Voucher details for PDF @Parthiban N */
		router.post('/webhook/getvoucherdocument', authMiddleware, async (req, res) => {
			try {
				new LogSys().log('Get Vouchers Documents');
				const { id, token } = req.body;

				const linkId = id;

				const { success, message, result } = await controller.getVoucherDoc(linkId);

				if (success) {
					const get = new Getters(ItemsService, accountabilitySchema);
					const linkDetailsArr = await get.getLinkDetailsForPDF(id);
					const linkDetails = linkDetailsArr[0];

					if (linkDetails && linkDetails['status'] == 'redeemed') {
						const linkRedemptionsArr = linkDetails['redemptions'];
						/* Get Voucher Details */
						const getVouchersFromZeusResponse = await get.vouchersFromIds(id, linkRedemptionsArr);
						/* Get Redemption Details */
						const getRedemptionsResponse = await get.redemptionsFromIds(linkRedemptionsArr);
						/* Get Failed Ledgers of the Link */
						const getFailedLedgersResponse = await get.getFailedLinkLedgerForLink(id);
						const neededSkus:any = [];
						if (getVouchersFromZeusResponse && getVouchersFromZeusResponse.length) {
							getVouchersFromZeusResponse.forEach(function (data, index) {
								neededSkus.push(data['product_code']);
							});
						}

						if (getFailedLedgersResponse && getFailedLedgersResponse.length) {
							getFailedLedgersResponse.forEach((failedOrder) => {
								const { reference_id } = failedOrder;
								const productCode = reference_id.split('-')[0];
								neededSkus.push(productCode);
							});
						}
						/* Get All Available SKUs */
						const allRewardSKUs = await get.getAllRewardSKUs(neededSkus);

						let responseData: any = [];
						/* Successfully redeemed Voucher Cards */
						if (getVouchersFromZeusResponse && getVouchersFromZeusResponse.length) {
							getVouchersFromZeusResponse.forEach(function (data, index) {
								const rewardSku = allRewardSKUs.find((brand) => brand.sku === data['product_code']);
								responseData[index] = {};
								responseData[index].amount = data['price'];
								responseData[index].voucher = data['code'];
								responseData[index].pin = data['pin'];
								responseData[index].valid_till = data['validity'];
								responseData[index].claimed_date = getRedemptionsResponse.find(
									(redemption) => redemption.redemption_id == data['id']
								)['date_created'];
								responseData[index].image = rewardSku ? rewardSku.image : null;
								responseData[index].brand = rewardSku ? rewardSku.brand : null;
								responseData[index].redemption_process = rewardSku ? rewardSku.redemption_process : null;
							});
						}
						/* Pending Voucher Cards */
						if (getFailedLedgersResponse && getFailedLedgersResponse.length) {
							getFailedLedgersResponse.forEach((failedOrder) => {
								const { reference_id, date_created } = failedOrder;
								const productCode = reference_id.split('-')[0];
								const rewardSku = allRewardSKUs.find((brand) => brand.sku === productCode);
								responseData.push({
									amount: `${rewardSku ? rewardSku.value : ''}`,
									voucher: '',
									pin: '',
									valid_till: '',
									claimed_date: new Date(date_created).toISOString(),
									image: rewardSku ? rewardSku.image : null,
									brand: rewardSku ? rewardSku.brand : null,
									redemption_process: rewardSku ? rewardSku.redemption_process : null,
									pending: true,
								});
							});
						}

						let bg_left_content = process.env.PDF_IMAGE_LEFT;
						let bg_right_content = process.env.PDF_IMAGE_RIGHT;

						if (responseData.length < 50) {
							bg_left_content =
								'data:image/jpeg;base64,';
							bg_right_content =
								'data:image/jpeg;base64,';
						}

						// Define the HTML content for the PDF
						let html_content = '';

						// Style
						html_content +=
							'<html><head><link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Sofia"><style>.container{width:100%}.child-container{float:left;position:relative;text-align:center;color:#aa741e;width:46%}.voucher-value{position:absolute;top:45%;left:20%;transform:translate(-50%,-50%)}.brand-name{position:absolute;top:7%;width:100%;left:15%}.voucher{font-size:10px}.voucher-code{position:absolute;bottom:71%;left:61%;text-align:left;font-size:10px;color:#161616;}.voucher-pin{position:absolute;bottom:56.5%;left:61%;text-align:left;font-size:8px;color:#161616;}.spacing{margin:0;padding-top:5px}.scissor{display:flex;flex-flow:row;justify-content:center;align-items:center;margin:10px 10px 5px 0;width:100%}.scissor span{padding-right:10px}hr{flex:1}.odd-child{margin-left:3%;margin-bottom:5px}.no-page-break{page-break-inside:avoid}.header{margin-left:3%}</style></head><body>';

						let count = 1;

						for (let i = 0; i < responseData.length; i++) {
							let voucer = responseData[i];

							html_content +=
								'<div class="no-page-break"><div class="scissor"><i style="font-size:24px;color: #179CD7;">&#9988;</i><hr style="border: 1px dashed #179CD7" /></div>';

							html_content +=
								'<div class="child-container odd-child"><img src="' +
								bg_left_content +
								'" alt="voucher" style="width:100%;"></div>';

							html_content +=
								'<div class="child-container odd-child"><img src="' +
								bg_right_content +
								'" alt="voucher" style="width:100%;"><div class="voucher"><span class="voucher-code"><b>' +
								voucer['voucher'] +
								'</b></span><span class="voucher-pin"><b>' +
								voucer['pin'] +
								'</b></span></div></div></div>';

							if (!responseData[count]) {
								html_content +=
									'<div class="no-page-break"><div class="scissor"><i style="font-size:24px;color: #179CD7;">&#9988;</i><hr style="border: 1px dashed #179CD7" /></div></div>';
							} else {
								if (count % 5 === 0) {
									html_content +=
										'<div class="no-page-break"><div class="scissor"><i style="font-size:24px;color: #179CD7;">&#9988;</i><hr style="border: 1px dashed #179CD7" /></div></div></div>';
								}
							}

							count++;
						}

						html_content += '</body></html>';

						const encoded_html_content = Buffer.from(html_content, 'utf-8').toString('base64');

						const url = process.env.PDF_GENERATE_URL;

						const requestBody = {
							security_key: '6f34f84465f9a02',
							html_data: encoded_html_content,
						};

						const response = await axios
							.post(
								url,
								requestBody,
								{
									maxBodyLength: 150 * 1024 * 1024, // 150MB in bytes
									// maxBodyLength: Infinity,
								},
								{ timeout: 5000 }
							)
							.then((response) => {
								res.send(response.data);
							})
							.catch((error) => {
								res.send({
									success: false,
									message: 'Please contact: support@shakepe.com',
									error: error,
									response: null,
								});
							});
					} else {
						res.send({
							success: false,
							message: 'Please contact: support@shakepe.com',
							error: 'error',
							response: null,
						});
					}
				} else {
					res.send({
						success: false,
						message: 'Please contact: support@shakepe.com',
						error: message,
						response: null,
					});
				}
			} catch (err) {
				await logSys.error({ 'getvoucherdocument-error': err });
				res.send({
					success: false,
					message: err,
				});
			}
		});

		router.post('/webhook/linkresendredeem', authMiddleware, async (req, res) => {
			try {
				new LogSys().log('link re-send redeem Voucher');

				const { linkId, sku, redemption_id, link_ledger } = req.body;

				if (linkId && sku) {
					const { success, message } = await controller.softlinkresend(linkId, sku, redemption_id, link_ledger);

					new LogSys().log({
						api: 'Redeem Voucher',
						response: {
							success,
							message,
						},
					});

					res.send({
						success,
						message,
					});
				} else {
					res.send({
						success: false,
						message: 'Link /sku is invalid',
					});
				}
			} catch (err) {
				await logSys.error({ 'redeemvoucher-error': err });
				res.send({
					success: false,
					message: ' Router Server Error, Please try later.',
				});
			}
		});


	} catch (error) {
		console.log(error, 'error');
	}
});
